import React, { useState } from 'react';
import './booktickets.css';

function BookTickets() {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    phone: '',
    flight: '',
    location: '',
    departureDate: '',
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Form Data:', formData);
    // Perform API call to submit booking information
  };

  return (
    <div className="book-tickets-container">
      <h2>Book Your Flight</h2>
      <form onSubmit={handleSubmit}>
        <label>
          Name:
          <input type="text" name="name" value={formData.name} onChange={handleChange} />
        </label>
        <label>
          Email:
          <input type="email" name="email" value={formData.email} onChange={handleChange} />
        </label>
        <label>
          Phone Number :
          <input type="text" name="phone" value={formData.phone} onChange={handleChange} />
        </label>
        <label>
          Flight :
          <input type="text" name="flight" value={formData.flight} onChange={handleChange} />
          <select name="flight" > 
            <option value="Emirates" ></option>
            <option value="AirIndia" ></option>
            <option value="SpiceJ" ></option>

          </select>
        </label>
        <label>
          location :
          <input type="text" name="location" value={formData.location} onChange={handleChange} />
        </label>
        <label>
          Departure Date:
          <input type="date" name="departureDate" value={formData.departureDate} onChange={handleChange} />
        </label>
        <button type="submit">Book Now</button>
      </form>
    </div>
  );
}

export default BookTickets;
